import React from 'react';
import { Footer } from 'react-bootstrap';
import './Navbar.css';

const NavbarComponent = () => {
    return (
        <Footer>
            <div className="container">
                <p class="text-center">
                    Copyright &copy; D3 Teknologi Telekomunikasi 2021
                </p>
            </div>
        </Footer>
    )
}

export default NavbarComponent
